import React, { useEffect } from 'react'

const Profile = () => {
  useEffect = async() =>{
    var x= localStorage.getItem('reg');
    const res = await fetch('http://localhost:3001/find',{
        method:'POST',
        headers: {
             'Content-Type' : 'application/json'
        },
        body: JSON.stringify({
            x
        })
    })
  }
  return (
    <div>Profile</div>
  )
}

export default Profile
